import React from "react";
import instagram_logo from "./instagram_logo.png";
const Sidenav=()=>{

   return(
    <>
       <div className="navbar">
        <img src="{instagram_logo}" alt="instagram-logo"/>
       </div>
    </>
   );
}

export default Sidenav;
